import React,{ useState } from 'react'
// import { Button } from './Button'
import { Link } from 'react-router-dom'
import './Navbar.css'
import Dropdown from './Dropdown'
import logo from '../../src/assets/logo.png'
import logo1 from '../../src/assets/logo-white.png'
function Navbar(){
  const [click, setClick]= useState(false);
  const [dropdown, setDropdown] = useState(false);

  const handelClick = () => setClick(!click);
  const closeMobileMenu = () => setClick(false);

  const onMouseEnter = () => {
    if(window.innerWidth < 960){
      setDropdown(false);
    } else{
      setDropdown(true);
    }
  };
  const onMouseLeave = () => {
    if(window.innerWidth < 960){
      setDropdown(false);
    } else{
      setDropdown(false);
    }
  };
  return (
    <>
      <nav className="navbar">
        <Link to='/' className='navbar-logo'>
          <img src={logo} alt="S&S" />
        </Link>
        <div className='menu-icon' onClick={handelClick}>
          <i className={click ? 'fas fa-times' : 'fas fa-bars'} />

        </div>
        <ul className={click ? 'nav-menu active' : 'nav-menu'}>
          <li className='nav-item'>
            <Link to='/' className='nav-links' onClick={closeMobileMenu}>
              Home
            </Link>
          </li>
          <li className='nav-item'>
            <Link to='/Services' className='nav-links' onClick={closeMobileMenu}>
            Services
            </Link>
          </li>
          <li className='nav-item'>
            <Link to='/AboutApi' className='nav-links' onClick={closeMobileMenu}>
              About API
            </Link>
          </li>
          <li className='nav-item'>
            <Link to='/TravelDome' className='nav-links' onClick={closeMobileMenu}>
              Travel DOME
            </Link>
          </li>
          <li className='nav-item'
            onMouseEnter={onMouseEnter}
            onMouseLeave={onMouseLeave}
          >
            <Link to='/KnowUs' className='nav-links' onClick={closeMobileMenu}>
              {/* Know Us <i className='fas fa-caret-down' /> */}
            </Link>
            {dropdown && <Dropdown />}
          </li>
          <li className='nav-item'>
            <Link to='/ContactUs' className='nav-links' onClick={closeMobileMenu}>
              Contact Us
            </Link>
          </li>
          
        </ul>
      </nav>
    </>
  ) ;
}

export default Navbar;
